        try {
          createUserWithEmailAndPassword(auth, email, password)
          navigate("/login");
        } catch (error) {
          console.log(error);
        }
      };

      const googleLogin = async () => {
        try {
          signInWithPopup(auth, googleProvider)
          navigate("/");
        } catch (error) {
          console.log(error);
        }
      };


  return (
    <div>Signup</div>
  )
}

